•repayment of debt and scheduled principal payments of $107 million in the remainder of 2024 and $434 million in 2025;
•additional investments in current and future unconsolidated co-investment ventures and other ventures; and
•the acquisition of operating properties or portfolios of operating properties (depending on market and other conditions), for direct, long-term investment in our consolidated portfolio (this might include acquisitions from our unconsolidated entities).
We expect to fund our cash needs principally from the following sources (subject to market conditions):
•net cash flow from property operations;
•fees earned for services performed on behalf of co-investment ventures;
•distributions received from co-investment ventures;
•proceeds from the contribution of properties to current or future co-investment ventures;
•proceeds from the disposition of properties or other investments to third parties;
•available unrestricted cash balances ($501 million at March 31, 2024); •borrowing capacity under our current credit facility arrangements that allow us to borrow on a short-term basis, with original maturities ranging from overnight to three months ($5.3 billion available at March 31, 2024), including our commercial paper program that we established in the first quarter of 2024; and

•gains or losses from the disposition of land and development properties that were developed with the intent to contribute or sell;
•income tax expense related to the sale of investments in real estate;
•impairment charges recognized related to our investments in real estate generally as a result of our change in intent to contribute or sell these properties; and
•gains or losses from the early extinguishment of debt and redemption and repurchase of preferred stock. We use Core FFO, including by segment and region, to: (i) assess our operating performance as compared to other real estate companies; (ii) evaluate our performance and the performance of our properties in comparison with expected results and results of previous periods; (iii) evaluate the performance of our management; (iv) budget and forecast future results to assist in the allocation of resources; (v) provide guidance to the financial markets to understand our expected operating performance; and (vi) evaluate how a specific potential investment will impact our future results.
